  display: flex;
  align-items: center;
  text-decoration: none;
  color: map-get($color, text);
  font-weight: 700;
}

.navbar__menu {
  display: flex;
  align-items: center;
  list-style: none;
  margin: 0;
  padding: 0;

  .navbar__item {
    height: 70px;

    .navbar__links {
      @include flex;
      text-decoration: none;
      font-size: map-get($fontSize, sm);
      color: map-get($color, text);
      width: 125px;
      height: inherit;

      &.highlight {
        position: relative;

        &::after {
          content: "";
          position: absolute;
          width: 90%;
          height: 4px;
          border-radius: 3px;
          top: 98%;
          left: 50%;
          transform: translate(-50%, -98%);
          background: map-get($color, secondary);
          z-index: -1;
        }
      }
    }
  }
}

