    display: grid;
    grid-template-columns: auto;
    position: absolute;
    top: -1000px;
    left: 0;
    opacity: 0;
    transition: all 0.5s ease;
    width: 100%;
    padding: 0 2em 2em;

    &.active {
      background: map-get($color, primary);
      top: 100%;
      opacity: 1;
      z-index: 99;
      min-height: 50vh;
      transition: all 0.5 ease;
    }

    .navbar__item {
      width: 100%;

      .navbar__links {
        text-align: center;
        padding: 2rem;
        width: 100%;
      }
    }
  }

  @include mq(medium-xs) {
    .navbar__container {
      padding: 0 1.5em !important;
    }
  }

  .navbar__btn {
    display: none;
  }

  .navbar__toggle {
    display: flex;

    .burger {
      align-self: center;
      cursor: pointer;
    }

    .bar {
      width: 24px;
      height: 3px;
      margin: 4px auto;
      border-radius: 50px;
      transition: all 0.2s ease-in-out;
      background: map-get($color, text);
      display: block;
    }
